
import { Button } from "@/components/ui/button";
import { Card, CardContent } from "@/components/ui/card";
import { Link } from "react-router-dom";

const collectors = [
  {
    id: 1,
    name: "Lagos Waste Solutions",
    image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSQTO8Gsb-_XZbq8vJeryKjEsMvHrhpZdLwWA&s",
    rating: 4.8,
    reviews: 124,
    area: "Lagos State",
    services: ["Household", "Recycling"]
  },
  {
    id: 2,
    name: "Abuja Clean Initiative",
    image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR8Y3rkhaEX6zTdEADxKAaZVDrzSBKoXrVF-w&s",
    rating: 4.6,
    reviews: 98,
    area: "Central Abuja",
    services: ["Commercial", "Bulk Waste"]
  },
  {
    id: 3,
    name: "OGWAMA Cleaner Ogun",
    image: "data:image/jpeg;base64,",
    rating: 4.9,
    reviews: 156,
    area: "Ogun State",
    services: ["Recycling", "Household"]
  }
];

const CollectorHighlight = () => {
  return (
    <section className="py-16 bg-gray-50">
      <div className="container mx-auto px-4">
        <div className="text-center mb-12">
          <h2 className="text-3xl md:text-4xl font-bold mb-4">Meet Our Top Collectors</h2>
          <p className="text-gray-600 max-w-2xl mx-auto">
            Our platform features trusted waste collectors from across Nigeria. 
            These are some of our highest-rated partners.
          </p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {collectors.map((collector) => (
            <Card key={collector.id} className="overflow-hidden border-none shadow-lg">
              <div className="relative h-48 bg-gray-100">
                <img 
                  src={collector.image} 
                  alt={collector.name}
                  className="w-full h-full object-cover"
                />
                <div className="absolute top-4 right-4 bg-accent text-accent-foreground rounded-full px-3 py-1 text-sm font-medium">
                  â˜… {collector.rating}
                </div>
              </div>
              <CardContent className="p-6">
                <h3 className="font-bold text-xl mb-2">{collector.name}</h3>
                
                <div className="mb-4 text-gray-500 text-sm flex items-center justify-between">
                  <div className="flex items-center">
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-4 h-4 mr-1">
                      <path d="M21 10c0 7-9 13-9 13s-9-6-9-13a9 9 0 0 1 18 0z"></path>
                      <circle cx="12" cy="10" r="3"></circle>
                    </svg>
                    <span>{collector.area}</span>
                  </div>
                  <span>{collector.reviews} reviews</span>
                </div>
                
                <div className="flex flex-wrap gap-2 mb-6">
                  {collector.services.map((service, i) => (
                    <span 
                      key={i}
                      className="bg-primary-50 text-primary-600 px-3 py-1 rounded-full text-xs font-medium"
                    >
                      {service}
                    </span>
                  ))}
                </div>
                
                <div className="flex justify-between">
                  <Link to={`/collectors/${collector.id}`}>
                    <Button variant="outline">View Profile</Button>
                  </Link>
                  <Link to={`/schedule?collector=${collector.id}`}>
                    <Button>Request Pickup</Button>
                  </Link>
                </div>
              </CardContent>
            </Card>
          ))}
        </div>
        
        <div className="text-center mt-12">
          <Link to="/collectors">
            <Button variant="outline" size="lg">
              View All Collectors
            </Button>
          </Link>
        </div>
      </div>
    </section>
  );
};

export default CollectorHighlight;
